import React, { Component }  from 'react';
import Cart from './Cart'

export default class CartContainer extends Component {
    props = {
        items: [
            "pizza",
            "spaghetti",
            "salad"
        ]
    }

    render() {
        return (
            <div className="cart-container" style={{float:"right"}}>
                <Cart items={this.props.items}/>
            </div>
        )
    }
}
